import Link from 'next/link';
import { Button, Layout } from 'antd';

export default ({ children }) => {
  return (
    <Layout>
      <Layout.Header>
        <div className="header-left">
          <GithubOutlined />
        </div>
      </Layout.Header>
      <Layout.Content>{children}</Layout.Content>
      <Layout.Footer>
        Develop by ZJJ @{' '}
        <a href="https://github.com/zhangjunjie0730" target="__blank">
          github
        </a>
      </Layout.Footer>
    </Layout>
  );
};
